import React from 'react';

const heading = (props) => 
{ 
        return (
            <>
                <div className="col-md-3"><span className="h6">{props.title}</span></div>
                <div className="col-md-9"><p className={props.class}>{props.content}</p></div>
           </>
        ); 

}

export default heading;
